import React from 'react'
import { useTeaserPropertiesQuery} from '../../../generated/graphql'
import { Button, Grid } from '@material-ui/core';
import { PropertyCard } from '../../homepage/sections/propTeaserSectio/PropertyCard';
import { LoadingAnimation } from '../../pageframe/global/LoadingAnimation';
import { ErrorView } from '../../pageframe/global/ErrorView';
import { ListItem } from './lists/ListItem';

interface Props {
    onPropertySelected: (property: any) => void; 
}

export const PropertyList: React.FC<Props> = (props) => {

    const {data, loading, error} = useTeaserPropertiesQuery();


    if(loading){
        return (
            <LoadingAnimation message={'Daten werden geladen'}/>
        )
    }

    if(error){
        return (
            <ErrorView error={error}/>
        )
    }

    if(data && data.teaserProperties){
        return(

            <Grid container spacing={4}>
                {data?.teaserProperties.map(x => {
                return (
                    <Grid item>
                        <ListItem 
                            onEditClicked={props.onPropertySelected(x)} 
                            onDeletClicked={props.onPropertySelected(x)} 
                            id={x.id}
                            title={x.title}
                            tagone={x.location}
                            tagtwo={x.subtext}
                            tagthree={""} />

                    </Grid>)                
                })}
            </Grid>

        )

    }

    return (
        <LoadingAnimation message={'Daten werden geladen'}/>  
    )
}
